s="leeeeetcode"
t=""

class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if s==t:
            return True
        if len(s)==len(t) and s!=t:
            return False
        flag=0
        count=-1
        for i in range(len(s)):
            print("Count--{0} :: Length---{1} :: Exists {2} :: Si{3},T---{4}\n".format(count,len(t),s[i] in t,s[i],t))
            
            if s[i] in t:
                t=t.replace(t[:t.index(s[i])+1],"")
                continue
            else:
                flag=1
                break
        if(flag==1):
            return False
        else:
            return True
    def __init__(self) -> None:
        print(self.isSubsequence(s,t))
        
        

sol=Solution()